###Encryption SET
#Generate a secret key.
Function Set-SecretKey{
    [CmdletBinding()]
    Param
    (
        [string]$key
    )
 
    #Get key length.
    $Length = $key.Length;
    
    #Pad length.
    $Pad = 32-$Length;
    
    #If the length is less than 16 or more than 32.
    If(($Length -lt 16) -or ($Length -gt 32))
    {
        #Throw exception.
        Throw "String must be between 16 and 32 characters";
    }
    
    #Create a new ASCII encoding object.
    $Encoding = New-Object System.Text.ASCIIEncoding;
 
    #Get byte array.
    $Bytes = $Encoding.GetBytes($key + "0" * $Pad);
 
    #Return byte array.
    Return $Bytes;
}
#Encrypt data with a secret key.
Function Set-EncryptedData{
    [CmdletBinding()]
    Param
    (
        $key,
        [string]$TextInput
    )
    
    #Create a new secure string object.
    $SecureString = New-Object System.Security.SecureString
 
    #Convert the text input to a char array.
    $Chars = $TextInput.ToCharArray()
    
    #Foreach char in the array.
    ForEach($Char in $Chars)
    {
        #Append the char to the secure string.
        $SecureString.AppendChar($Char)
    }
    
    #Encrypt the data from the secure string.
    $EncryptedData = ConvertFrom-SecureString -SecureString $SecureString -Key $key
 
    #Return the encrypted data.
    Return $EncryptedData
}
#Decrypt data with a secret key.
Function Get-EncryptedData{
    [CmdletBinding()]
    Param
    (
        $key,
        $TextInput
    )
 
    #Decrypt the text input with the secret key.
    #$Result = $TextInput | ConvertTo-SecureString -Key $key | ForEach-Object {[Runtime.InteropServices.Marshal]::PtrToStringAuto([Runtime.InteropServices.Marshal]::SecureStringToBSTR($_))};
    $Result = $TextInput | ConvertTo-SecureString -Key $key -ErrorAction SilentlyContinue | ForEach-Object {[Net.NetworkCredential]::new('', $_).Password}
        if($?){
            #Checking password against existing DB
            Status green "decrypted"
            #Write-Warning "Entire DB loaded into variable in memory."
        }else{
            Status red "failed decryption"
            if($global:autoclose){Auto-Close}
            break
        }
    #Return the decrypted data.
    Return $Result
}
Function Set-Password(){
    #Create a secret key (between 16 or 32 in length).
    #$pwd = Read-Host -Prompt "Enter password" -AsSecureString
    #$cred = New-Object System.Net.NetworkCredential("TestUsername", (Read-Host -Prompt "Enter password" -AsSecureString), "TestDomain")
    $global:key = Set-SecretKey -Key ((New-Object System.Net.NetworkCredential("TestUsername", (Read-Host -Prompt "Enter password" -AsSecureString), "TestDomain")).Password)
    #Remove-Variable pwd, cred
    return $global:key
}
 
###DB SET
Function Load-DB {
    [CmdletBinding()]
    [alias("loaddb")]
    Param(
        [Parameter(Mandatory=$true)]
        [System.IO.FileInfo]$path,
        $key,
        [bool]$force,
        [bool]$test
    )
    $global:path = $path #grab the path we loaded from as the default destination for later saves
    if($Global:DB -and !$force){
        Write-Warning "DB already loaded in memory"
        Write-Host $Global:path
        $c = Default-Value "Type 'true' to confirm" ""
        if($c -eq $true){
            Status green "confirmed"
            ###whitespace
        }else{
            Status green "aborted"
            ###whitespace
            if($global:autoclose){Auto-Close}
            break
        }
    }
    if(!$key){$key = Set-Password}
    $EncryptedData = Get-Content $path
    $DBJson = Get-EncryptedData -Key $key -TextInput $EncryptedData
    if(!$test){
        $global:DB = $DBJson | ConvertFrom-Json
        if($Global:DB){
            Status green "loaded $($Global:DB.count) entries"
            if($global:autoclose){Auto-Close}
        }else{
            Status red "DB not loaded" 
        }
        ###whitespace
    }
 
    #Remove-Variable key 
    }
Function Save-DB {
    [CmdletBinding()]
    [alias("savedb")]
    Param(
        #$DB,
        [Parameter(Mandatory=$false)]
        [System.IO.FileInfo]$path,
        $key,
        [bool]$force = $false,
        [bool]$auto
    )
    if(!$global:DB){
        Status red "nothing loaded"
        #no autoclose if nothing loaded
        break
    }
    if(!$path){#if path wasn't passed in param
        $path = $global:Path   
    }
    if(!$key){
            $key = Set-Password
        }
    if($force -eq $false -and (Test-Path $path)){
        #try reading the file with the pwd provided, if it succeeds then the password was entered correctly
        [void](Load-DB $path $key -force $true -test $true)
    }else{
        Write-Warning "You're about to encrypt and write/clobber the DB with a new password: at $($path)"
        $c = Default-Value "Type 'true' to confirm" ""
        if($c -eq $true){
            Status green "confirmed"
        }else{
            Status green "aborted"
            if($global:autoclose){Auto-Close}
            break
        }
    }
    $DBJson = $global:DB | ConvertTo-Json
    #Encrypt data with the secret key.
    $EncryptedData = Set-EncryptedData -Key $key -TextInput $DBJson
 
    $EncryptedData | Out-File $path
    if($?){
            Status green "saved"
        }else{
            Status red "write failed"
        }
    ###whitespace
    if($global:autoclose -and $auto -eq $false){Auto-Close}
    #Remove-Variable key
}
Function Close-DB{
    [CmdletBinding()]
    [alias("closedb")]
    Param(
        [bool]$auto,
        [switch]$done
    )
    ###whitespace
    if($auto -ne $null){
        $c = $true
    }else{
        if($Global:DB){
            Write-Host "Current DB: $($global:path)"
        }
        Write-Warning "Have you saved? Are you sure?"
        $c = Default-Value "Type 'true' to confirm" ""
    }
        if($c -eq $true){
        
    <#
        #Invoke a new instance of PowerShell, get the built-in variables, then remove everything else that doesn't belong.
        $ps = [PowerShell]::Create()
        $ps.AddScript('Get-Variable | Select-Object -ExpandProperty Name') | Out-Null
        $builtIn = $ps.Invoke()
        $ps.Dispose()
        $builtIn += "profile","psISE","psUnsupportedConsoleApplications" # keep some ISE-specific stuff
        Remove-Variable (Get-Variable | Select-Object -ExpandProperty Name | Where-Object {$builtIn -NotContains $_}) -ErrorAction SilentlyContinue
        Remove-Variable "DB", "global:DB" -Force -ErrorAction SilentlyContinue
 
        #>
        ###whitespace
        $Global:DB = $null
        $Global:key = $null
        Start-Sleep 1
        if($Global:DB -eq $null -and $Global:key -eq $null){
                Status green "cleared vars"
            }else{
                Status red "vars not cleared"
            }
        Clear-History
        if($?){
            Status green "cleared history"
        }else{
            Status red "history not cleared"
            }
        Write-Warning "Garbage collector may allow some objects to remain in memory."
        Write-Host "Close this instance of PowerSheell where this risk is unacceptable."
        Start-Sleep 3
 
        if($auto -eq $true){
            Clear
            #$eggpicEnc = [convert]::ToBase64String([Text.Encoding]::UTF8.GetBytes($eggpic))
            $eggpicEnc = ''
            Write-Host ([Text.Encoding]::UTF8.GetString([convert]::FromBase64String($eggpicEnc)))
            $lyricsEnc = 'TmV2ZXIgZ29ubmEgZ2l2ZSB5b3UgdXAsTmV2ZXIgZ29ubmEgbGV0IHlvdSBkb3duLE5ldmVyIGdvbm5hIHJ1biBhcm91bmQgYW5kIGRlc2VydCB5b3UsTmV2ZXIgZ29ubmEgbWFrZSB5b3UgY3J5LE5ldmVyIGdvbm5hIHNheSBnb29kYnllLE5ldmVyIGdvbm5hIHRlbGwgYSBsaWUgYW5kIGh1cnQgeW91LA=='
            foreach ($l in ([Text.Encoding]::UTF8.GetString([convert]::FromBase64String($lyricsEnc)).split(','))){
                Write-Output $l
                Start-Sleep 1
                }
                Start-Sleep 3
        }
        if($done){
            exit
        }else{
            Main-Func
        }
 
    }else{
            Status green "aborted"
            if($global:autoclose){Auto-Close}
            break
        }
}
 
Function done (){
    closedb 0 -done
}
 
Function Auto-Close {
    if($global:autoclose){
    if($global:autosaveMins -eq 1){
        $plural = ""
    }else{
        $plural = "s"
    }
    For (($i=1), ($sec=(60*$global:autosaveMins)); $i -lt $sec; $i++) {
        Write-Progress -Activity "Auto Close" -Status "Closing in $($global:autosaveMins) minute$($plural)" -PercentComplete (($i/$sec)*100) #-CurrentOperation ($sec-$i)
        Start-Sleep -Milliseconds 1000
        }
        Write-Progress -Activity "Auto Close" -Status "Ready" -Completed
        if($global:autosave){
            Write-Host "auto save..."
            Save-DB $global:path $key -auto $true
            }
        Close-DB -auto $true
        Main-Func
        }
}
Function Import-KeePassXML{
    [CmdletBinding()]
    Param(
        [Parameter(Mandatory=$false)]
        [System.IO.FileInfo]$path
    )
    ###whitespace
    Write-Host "From the KeePass DB, select all entries, then use the ribbon:"
    Write-Host "     Entry > Data Exchange > Export Entry > KeePass XML (2x)"
    ###whitespace
    Write-Host "Created/modified dates cannot be imported, and will be set to today's date"
    Pause
    $path = Read-Host "Enter path of XML"
    try{Test-Path $path}
    catch{
        Write-Warning "No file found at that location"
        Status red "aborting"
        if($global:autoclose){Auto-Close}
        break
        }
    $XPath = "/KeePassFile/Root/Group"
    $obj = Select-Xml -Path $Path -XPath $Xpath | Select-Object -ExpandProperty Node
 
    $all = @()
    foreach ($o in $obj.Entry){
        $item = New-Object -TypeName PSobject
            $item | Add-Member -MemberType NoteProperty -Name "name" -Value (($o.string) | ?{$_.key -eq 'Title'}).value
            $item | Add-Member -MemberType NoteProperty -Name "username" -Value (($o.string) | ?{$_.key -eq 'UserName'}).value
            $item | Add-Member -MemberType NoteProperty -Name "password" -Value (($o.string) | ?{$_.key -eq 'Password'}).value.'#text'
            $item | Add-Member -MemberType NoteProperty -Name "url" -Value (($o.string) | ?{$_.key -eq 'URL'}).value
            $item | Add-Member -MemberType NoteProperty -Name "notes" -Value (($o.string) | ?{$_.key -eq 'Notes'}).value
            $item | Add-Member -MemberType NoteProperty -Name "modified" -Value (Get-Date)
            $item | Add-Member -MemberType NoteProperty -Name "created" -Value (Get-Date)
    
        $all += $item
        }
        Status green "$($all.count) records loaded"
 
        <#
        Write-Host "Do you want to merge DBs?"
        $c = Default-Value "Type 'true' to confirm" ""
        if($c -eq $true){
            if(!$Global:DB){
                Write-Warning "This will combine any loaded DB with the file at $($path)"
                $c = Default-Value "Type 'true' to confirm" ""
                if($c -eq $true){
                    Write-Host -BackgroundColor yellow -ForegroundColor Black " merging "
                    Write-Host "THIS HAS NOT BEEN IMPLMENTED YET. WOULD REQUIRE SOME LOGIC TO KNOW RECORDS TO KEEP IF CONFLICT"
                    Status red "aborting"
                    if($global:autoclose){Auto-Close}
                    break
                }
                }
            Write-Warning "No loaded DB, nothing to merge"
            Status red "aborting"
            if($global:autoclose){Auto-Close}
            break
            }else{
 
            }
        #>
        $Global:DB = $all
        if($global:autoclose){Auto-Close}
        return $Global:DB | Out-Null
}
 
###Read entries SET
Function Test-DBloaded {
    if(!$global:DB){
        Status red "nothing loaded"
        #no autoclose if nothing loaded
        break
    }
}
Function Get-Entry{
    [CmdletBinding()]
    [alias("gete")]
    Param
    (
        [Parameter(Mandatory=$true)]
        [string]$name
    )
    Test-DBloaded
    $line = $global:DB | ?{$_.name -like $name} 
    if(!$line){
        Write-Warning "no entry found with the name $($name)"
        Status green "aborted"
        if($global:autoclose){Auto-Close}
        break
    }
    if($line.count -gt 1){
        $line | select name, username, @{Name="password"; Expression={"REDACTED"}}, url, @{Name="notes"; Expression={$_.notes.Substring(0,[Math]::Min($_.notes.Length, 40))}} | ft
        Write-Warning "I found all these..."
        Status green "aborted"
        if($global:autoclose){Auto-Close}
        break
    }
    return $line
}
Function List-Entries{
    [CmdletBinding()]
    [alias("lse")]
       param($name)
 
    Test-DBloaded
    if($name){
        #get the one requested
        Get-Entry $name
    }else{
        #list all
        $global:DB | sort name | select name, username, <#@{Name="password"; Expression={"REDACTED"}},#> @{N="modified"; E={$_.modified.ToString("MM/dd/yy")}}, @{N="created"; E={$_.created.ToString("MM/dd/yy")}}, url <#@{Name="notes"; Expression={$_.notes.Substring(0,[Math]::Min($_.notes.Length, 40))}}#> | ft
    }
    if($global:autoclose){Auto-Close}
}
 
