    $line = @()
    $line = "" | select name,username,password,url,notes,modified,created
    return $line
}
Function New-Password {
    [CmdletBinding()]
    [alias("newpwd")]
       param($return)
 
    if($return){
        $c = Default-Value "Generate pwd?" $false
        }else{
        $c = $true
        }
    if($c -eq $true){
        $c = Default-Value '"random" or "diceware?"' "random"
        if($c -eq "Random"){
            $length = Default-Value "length" 16
            $upper = Default-Value "upper" 2
            $lower = Default-Value "lower" 2
            $numeric = Default-Value "numeric" 2
            $special = Default-Value "special" 2
            $pwd = Get-RandomPassword 16 -upper $upper -lower $lower -numeric $numeric -special $special
            }
        if($c -eq "Diceware"){
            [string]$pwd = New-DiceWare
            }
        }else{
        [string]$pwd = Default-Value "password" $line.password
    }
    if(!$return){
        ###whitespace
        $pwd | Set-Clipboard
        Status green "copied password"
        Write-Host "clearing clipboard"
        Write-Host "         v"
        foreach ($n in 0..8){
                Start-Sleep 1
                Write-Host -NoNewline "-"
            }
        Set-Clipboard "---"
        if((Get-Clipboard) -eq "---"){
            Status green "cleared"
        }else{
            Status red "not cleared"
        }
        if($global:autoclose){Auto-Close}
            
        }else{
            return $pwd
        }   
}
Function Edit-Entry{
    [CmdletBinding()]
    [alias("edite")]
    Param
    (
        [Parameter(Mandatory=$true)]
        [string]$name
    )
    $line = Get-Entry $name
    $line
 
    Write-Warning "Every change will be committed imeadiately"
    $c = Default-Value "Edit this entry?" $true
    if($c -ne $true){
        ###whitespace
        Write-Warning "Don't waste my time."
        Status red "aborted"
        if($global:autoclose){Auto-Close}
        break
    }
    $line.name = Default-Value "name" $line.name
    try{$line.modified = Get-Date}
    catch{$line | Add-Member -MemberType NoteProperty -Name "modified" -Value (Get-Date)}
    if($line.name -eq $null){
        Write-Warning "name cannot be null"
        Status red "aborted"
        if($global:autoclose){Auto-Close}
        break
        }
    $line.username = Default-Value "username" $line.username
    $line.password = New-Password -return $true
 
    $line.url = Default-Value "url" $line.url
    
    $c = Default-Value 'Edit notes in gui?' $true
    if($c -eq $true){
            $line.notes = Edit-Notes $line.name -auto $true
        }else{
            $line.notes = Default-Value "notes" $line.notes
        }
    ###whitespace
    if($global:autosave){
        Write-Host "autosave..."
        savedb $global:path $key
        }
    if($global:autoclose){Auto-Close}
    return $line
}
Function New-Entry{
    [CmdletBinding()]
    [alias("newe")]
        Param
    (
        [Parameter(Mandatory=$false)]
        [string]$name
    )
    $line = Initialize-Entry
    $line.name = Default-Value "name" $name
    if($line.name -eq ""){
        Write-Warning "name cannot be null"
        Status red "aborted"
        if($global:autoclose){Auto-Close}
        break
        }
    if($line.name -in $DB.name){
        Write-Warning "name already in use"
        $DB | ?{$_.name -eq $line.name}
        Status red "aborted"
        if($global:autoclose){Auto-Close}
        break
        }
    $line.username = Default-Value "username" ""
    $line.password = New-Password -return $true
    $line.url = Default-Value "url" ""
    $c = Default-Value 'Edit notes in gui?' $true
    if($c -eq $true){
            $line.notes = Edit-Notes -auto $true #Don't pass a name, it's a new entry
        }else{
            $line.notes = Default-Value "notes" ""
        }
    $line.modified = Get-Date
    $line.created = Get-Date
    ###whitespace
    $line
    $c = Default-Value "Look good?" $true
    if($c -eq $true){
        $global:DB += $line
        Status green "created"
    }else{
        ###whitespace
        Write-Warning "Don't waste my time."
        Status red "aborted"
        if($global:autoclose){Auto-Close}
        break
    }
    if($global:autosave){
        Write-Host "autosave..."
        Save-DB $global:path $key
        }
    if($global:autoclose){Auto-Close}
    return $line | Out-Null #nothing calls this. no console output or return needed.
}
Function Remove-Entry{
    [CmdletBinding()]
    [alias("rme")]
    Param
    (
        [Parameter(Mandatory=$true)]
        [string]$name
    )
    $line = Get-Entry $name
    $line
    Write-Warning "Remove this entry?"
 
    $c = Default-Value "Type 'true' to confirm" ""
    if($c -eq $true){
        $global:DB = $global:DB.where({ $_ -notin $line })
        if($?){
            Status red "removed"
        }
    }else{
        Status green "aborted"
        if($global:autoclose){Auto-Close}
        break
    }
 
    if($global:autosave){
        Write-Host "autosave..."
        savedb $global:path $key
        }
    if($global:autoclose){Auto-Close}
}
Function Edit-Notes (){
    [CmdletBinding()]
    [alias("vim")]
    Param
    (
        [Parameter(Mandatory=$false)]
        [string]$name,
        [bool]$auto
    )
 
    if($name){
            #must be an edit, expect a match
            $line = Get-Entry $name
        }else{
            #nothing, it's a new entry
        }
    
    Add-Type -assembly System.Windows.Forms
    $form = New-Object System.Windows.Forms.Form
    $form.Text ='Edit Notes'
 
    $form.Width = 600
    $form.Height = 400
    $form.AutoSize = $true
 
    $TextBox = New-Object System.Windows.Forms.TextBox
    $TextBox.Multiline = $True
    $TextBox.AcceptsReturn = $true
    $TextBox.AcceptsTab = $false
    $TextBox.Location = New-Object System.Drawing.Size(10,10)
    $TextBox.Size = New-Object System.Drawing.Size(560,300)
    $TextBox.Scrollbars = "Vertical" 
    $TextBox.Text = $line.notes
    $form.Controls.Add($TextBox)
 
    $okButton = New-Object System.Windows.Forms.Button
    $okButton.Location = New-Object System.Drawing.Point(10,320)
    $okButton.Size = New-Object System.Drawing.Size(75,23)
    $okButton.Text = 'OK'
    $okButton.DialogResult = [System.Windows.Forms.DialogResult]::OK
    $form.AcceptButton = $okButton
    $form.Controls.Add($okButton)
 
    $cancelButton = New-Object System.Windows.Forms.Button
    $cancelButton.Location = New-Object System.Drawing.Point(100,320)
    $cancelButton.Size = New-Object System.Drawing.Size(75,23)
    $cancelButton.Text = 'Cancel'
    $cancelButton.DialogResult = [System.Windows.Forms.DialogResult]::Cancel
    $form.CancelButton = $cancelButton
    $form.Controls.Add($cancelButton)
 
    $resp = $form.ShowDialog()
    
    if($resp -eq "OK"){
            $line.notes = $TextBox.Text
            $line.modified = Get-Date
            Status green "updated notes"
        }else{
            Status red "discarded notes changes"
        }
    if(!$auto){
        if($global:autosave){
            Write-Host "autosave..."
            savedb $global:path $key
            }
        if($global:autoclose){Auto-Close}
    }
    return $line.notes
    }
 
###Passwords SET
function Get-RandomPassword {
    param (
        [Parameter(Mandatory)]
        [ValidateRange(4,[int]::MaxValue)]
        [int] $length,
        [int] $upper = 1,
        [int] $lower = 1,
        [int] $numeric = 1,
        [int] $special = 1
    )
    if($upper + $lower + $numeric + $special -gt $length) {
        throw "number of upper/lower/numeric/special char must be lower or equal to length"
    }
    $uCharSet = "ABCDEFGHIJKLMNOPQRSTUVWXYZ"
    $lCharSet = "abcdefghijklmnopqrstuvwxyz"
    $nCharSet = "0123456789"
    $sCharSet = "/*-+,!?=()@;:._"
    $charSet = ""
    if($upper -gt 0) { $charSet += $uCharSet }
    if($lower -gt 0) { $charSet += $lCharSet }
    if($numeric -gt 0) { $charSet += $nCharSet }
    if($special -gt 0) { $charSet += $sCharSet }
    
    $charSet = $charSet.ToCharArray()
    $rng = New-Object System.Security.Cryptography.RNGCryptoServiceProvider
    $bytes = New-Object byte[]($length)
    $rng.GetBytes($bytes)
 
    $result = New-Object char[]($length)
    for ($i = 0 ; $i -lt $length ; $i++) {
        $result[$i] = $charSet[$bytes[$i] % $charSet.Length]
    }
    $password = (-join $result)
    $valid = $true
    if($upper   -gt ($password.ToCharArray() | Where-Object {$_ -cin $uCharSet.ToCharArray() }).Count) { $valid = $false }
    if($lower   -gt ($password.ToCharArray() | Where-Object {$_ -cin $lCharSet.ToCharArray() }).Count) { $valid = $false }
    if($numeric -gt ($password.ToCharArray() | Where-Object {$_ -cin $nCharSet.ToCharArray() }).Count) { $valid = $false }
    if($special -gt ($password.ToCharArray() | Where-Object {$_ -cin $sCharSet.ToCharArray() }).Count) { $valid = $false }
 
    if(!$valid) {
         $password = Get-RandomPassword $length $upper $lower $numeric $special
    }
    return $password
}
Function New-DiceWare ($numWords){
    #REFRENCES
    #https://generatepasswords.org/how-to-calculate-entropy/
    #https://theworld.com/~reinhold/dicewarefaq.html#calculatingentropy
    #https://docs.microsoft.com/en-us/powershell/module/microsoft.powershell.utility/get-random?view=powershell-7.2
    #"By default, Get-Random generates cryptographically secure randomness using the RandomNumberGenerator class."
    #https://docs.microsoft.com/en-us/dotnet/api/system.security.cryptography.randomnumbergenerator?view=net-6.0
 
 
    <# TO PERFORM ENCODING
    $encoded = [Convert]::ToBase64String(
      [System.Text.Encoding]::Unicode.GetBytes(
        (Get-Content -Path "wordlist.txt" -Raw -Encoding UTF8)
      )
    )
    #>
 
    #Wordlist
    $encoded = ''
    $words = ([System.Text.Encoding]::Unicode.GetString([System.Convert]::FromBase64String($encoded))).split("`r`n")
 
 
    #Setup calculated entropy
    #this portion accounts for poor rolls
    #unique chars across all diceware words: 54
    #unique chars by position in words: 53, 45, 40, 37, 25, 23
    #+1 for possible spaces
    $charWord1 = 53 + 1
    $charWord2 = 53 * 45 + 1
    $charWord3 = 53 * 45 * 40 + 1
    $charWord4 = 53 * 45 * 40 * 37 + 1
    $charWord5 = 53 * 45 * 40 * 37 * 25 + 1
    $charWord6 = 53 * 45 * 40 * 37 * 25 * 23 + 1
 
    #Sample: alaska pin cdc fd billy
    # 6, 3, 3, 2, 5
    #$combos = $charWord6 * $charWord3 * $charWord3 * $charWord2 * $charWord5
    #$entropyBits = [Math]::Log($combos, 2)
    #Result: 102.242751728801
    #Vs diceware claim for five words: 64.6240625180289
 
    #consider 5 words at 3 letters each, the calculated entropy is 83.1800073141928 and for 2 character words it's 56.3922472911024.
    #The minimum length accounts for this a bit, however, word counts approaching the minimum length start to narrow the keyspace significantly where an attacker knows diceware was used to generate.
    #the calculated entropy provides a more concrete understanding of the entropy of the password generated.
 
 
    $combos = 1
    if(!$numWords){
        $numWords = Default-Value "number of words" 5
        }
    $wordErr = $false
    switch ($numWords) {
        {$PSItem -lt 5} {$wordErr = $true} #alert
        5 {$minLen = 17}
        6 {$minLen = 19}
        7 {$minLen = 20}
        8 {$minLen = 22}
        {$PSItem -gt 8} {$minLen = 0} #don't alert
    }
    $pwdStr = ''
    $i = 0
    while ($i -lt $numWords){
        $word = (Get-Random $words).split(":")[1]
        $pwdStr += "$($word) "
 
        switch ($word.Length) {
            1 {$combos = $combos * $charWord1}
            2 {$combos = $combos * $charWord2}
            3 {$combos = $combos * $charWord3}
            4 {$combos = $combos * $charWord4}
            5 {$combos = $combos * $charWord5}
            6 {$combos = $combos * $charWord6}
        }
        $i++
        }
 
    #Warnings
    if($pwdStr.Length -lt $minLen){
        Write-Host -ForegroundColor Red "Shorter than recommended length of $($minLen)"
    }
    if($wordErr){
        Write-Host -ForegroundColor Red "At least 5 words are recommended"
    }
 
 
    #Write-Host "copied to clipboard:"
    #$pwdStr | Set-Clipboard
    Write-Host ''
    Write-Host "`t$($pwdStr)"
    Write-Host ''
    #entropy according to Diceware
    $possibleWords = 7776 #word list count
    $numGuesses = $numWords 
 
    [double]$claimedCombos = [Math]::Pow($possibleWords, $numWords)
    $entropyBitsClaimed = [Math]::Log($claimedCombos, 2)
 
    #Write-Host "bits of entropy"
    Write-Host "`tdiceware claims entropy:`t$($entropyBitsClaimed)"
    #$entropy = "`tdiceware claims entropy:`t$($entropyBitsClaimed)"
    #entropy according to unique characters by position
        $entropyBitsCalculated = [Math]::Log($combos, 2)
 
        Write-Host "`tcalculated entropy:`t`t$($entropyBitsCalculated)"
 
    return $pwdStr.Replace(' ','') #, $entropy, $entropyBitsCalculated
}
 
###Execute entries SET
Function Use-Entry{
    [CmdletBinding()]
    [alias("usee")]
    Param
    (
        [Parameter(Mandatory=$true)]
        [string]$name
    )
    $line = Get-Entry $name
    ###whitespace
    Write-Host "$($line.name)"
 
    $line.username | Set-Clipboard
    Status green "copied username"
    ###whitespace
    $c = Default-Value "go to site?" $true
    if($c -eq $true){
           if(!$line.url){
                Write-Warning "Url is null"
                Status red "aborting"
            }else{
                $trg = "microsoft-edge:$($line.url)"
                Start-Process $trg
            }
           Pause
        }else{
            ###whitespace
        }
 
    ###whitespace
    $line.password | Set-Clipboard
    Status green "copied password"
 
    For (($i=1), ($sec=(10)); $i -lt $sec; $i++) {
            Write-Progress -Activity "password coppied" -Status "clearing clipboard in $($sec-$i)" -PercentComplete (($i/$sec)*100) #-CurrentOperation ($sec-$i)
            Start-Sleep -Milliseconds 1000
        }
    Write-Progress -Activity "password coppied" -Status "Ready" -Completed
 
    Set-Clipboard "---"
    if((Get-Clipboard) -eq "---"){
        Status green "cleared"
    }else{
        Status red "not cleared"
    }
    if($global:autoclose){Auto-Close}
}
Function Use-Password{
    [CmdletBinding()]
    [alias("usepwd")]
    Param
    (
        [Parameter(Mandatory=$true)]
        [string]$name
    )
    $line = Get-Entry $name
    ###whitespace
    Write-Host "$($line.name)"
 
    $line.password | Set-Clipboard
    Write-Host "copied password"
 
    For (($i=1), ($sec=(10)); $i -lt $sec; $i++) {
            Write-Progress -Activity "password coppied" -Status "clearing clipboard in $($sec-$i)" -PercentComplete (($i/$sec)*100) #-CurrentOperation ($sec-$i)
            Start-Sleep -Milliseconds 1000
        }
    Write-Progress -Activity "password coppied" -Status "Ready" -Completed
 
    Set-Clipboard "---"
    if((Get-Clipboard) -eq "---"){
        Status green "cleared"
    }else{
        Status red "not cleared"
    }
    if($global:autoclose){Auto-Close}
}
Function Use-URL {
    [CmdletBinding()]
    [alias("useurl")]
    Param
    (
        [Parameter(Mandatory=$true)]
        [string]$name
    )
    $line = Get-Entry $name
    ###whitespace
    #Write-Host "$($line.name)"
 
    if(!$line.url){
        Write-Warning "Url is null"
        start-job -ScriptBlock {Status red "aborting"}
    }else{
        $trg = "microsoft-edge:$($line.url)"
        Start-Process $trg
    }
    if($global:autoclose){Auto-Close}
}
 
