Function Main-Func(){
    clear
    Get-Logo
    Write-Host "PowerShell Password Manager for the CLI guy"
 
    Write-Host @'
    
     * FIPS 140-2 compliant encryption methods
     * Fully in-memory
     * PSH native, no modules, no binaries.
       Copyright (c) 2023 Jared Lettau
 
'@
    #https://social.technet.microsoft.com/Forums/en-US/91401777-dbf7-44b3-8e8a-51543d99f8fe/trying-to-use-convertfromtosecurestring-with-a-key-specified
    #variables
    $autoLoad = $True
    $global:autosave = $True
    $global:autoclose = $True
    $global:autosaveMins = 5
    $Global:path = Join-Path $PSScriptRoot 'mydb.bin' #lookds for this file in the script folder
 
    write-host ""
    if($autoLoad){
        Write-Host "auto load ----- $($Global:path)"
    }else{
        Write-Host "auto load ----- $($autoLoad)"
    }
        Write-Host "auto close ---- $($global:autoclose)"
        Write-Host "auto save ----- $($global:autosave)"
    if($autosave){
       Write-Host  "auto save min - $($global:autosaveMins)"
    }
    write-host ""
 
    if(!$global:scriptFunctions){
        $global:scriptFunctions = Get-ChildItem function: | Where-Object { $global:currentFunctions -notcontains $_ }
    }
    if($global:scriptFunctions -or (Get-ChildItem function: | Where-Object { $_.Name -eq "Load-DB" })){
        Status green "imported functions"
        #$scriptFunctions.Name
    }else{
        Status red "import failed"
    }
    if($autoLoad){
        if(!$global:DB){
            Load-DB $Global:path #$autoSave
        }else{
            Status green "$($Global:DB.count) entries"
            if($global:autoclose){Auto-Close}
        }
    }
}
 
